import React from 'react'
import Logo from '../../assets/Logo.png'
import './NavBar.css'

function NavBar() {
  return (
    <nav className="nav">
        <img src={Logo} alt="logo"></img>
        import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

    </nav>
  )
}

export default NavBar;
